import { Link } from "react-router-dom";

function Register() {
  return(
    <div className="auth">
      <h2 className="auth__title">Вход</h2>
      <form className="auth__form">

        <input
          className='auth__input'
          value={''}
          placeholder="Email"
          type="email"
          name="email"
        />


        <input
          className='auth__input'
          value={''}
          placeholder="Пароль"
          type="password"
          name="password"
        />


        <button className='auth__submit-button' type="submit">Войти</button>
      </form>
      <Link className="auth__link">Уже зарегистрированы? Войти</Link>
    </div>
  );
}

export default Register;
